import React, { useEffect, useState } from 'react';

const ScoredPicksPage = () => {
  const [scores, setScores] = useState([]);

  useEffect(() => {
    fetch('http://localhost:4000/api/scores')
      .then(res => res.json())
      .then(data => setScores(data))
      .catch(err => console.error('Error fetching scores:', err));
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2>Weekly Scored Picks</h2>
      <table border="1" cellPadding="10" style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>Player</th>
            <th>Week</th>
            <th>Picks</th>
            <th>Correct Picks</th>
            <th>Weekly Score</th>
            <th>Total Score</th>
            <th>‚≠ê</th>
            <th>Praise</th>
          </tr>
        </thead>
        <tbody>
          {scores.map((player, index) => (
            <tr key={index}>
              <td>{player.name}</td>
              <td>{player.week}</td>
              <td>{player.picks.join(', ')}</td>
              <td>{player.correctPicks.join(', ')}</td>
              <td>{player.weeklyScore}</td>
              <td>{player.totalScore}</td>
              <td>{player.goldStar}</td>
              <td>{player.praise}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ScoredPicksPage;
